import MenuItems from './MenuItem'

class LightVersion extends Component {

    render() {
        return (
            <div className="">
                <MenuItems menuName="Home" linkTo="/" />
                <MenuItems menuName="about" linkTo="/" />
            </div>
        );
    }
}

export default LightVersion;
